import React, { Component } from 'react';

class About extends Component {
  render() {
    return (
        <p id="about" style={{paddingTop:'30px'}}>
            <h2>About me</h2>
            <p>I am a first-year undergraduate student at Singapore Management University, currently pursuing a bachelor's degree in Computer Science and a second major in Business. Highly motivated  I love to code, design, and constantly strive to improve my skills.</p>
        </p> 
    );
  }
}

export default About;
